import React from 'react';
import { Form, Input, Checkbox, Button } from 'antd';

const Signup = () => {

    const onSubmit = () => {};

    const onChageId = () => {};

    const onChageNick = () => {};

    const onChagePassword = () => {};

    const onChagePasswordChk = () => {};

    const onChangeTerm = () => {};

    return (
        <Form onSubmit={onSubmit}>
            <div>
                <label htmlFor="user-id">아이디</label>
                <Input name="user-id" required onChange={onChageId} />
            </div>
            <div>
                <label htmlFor="user-nick">닉네임</label>
                <Input name="user-nick" required onChange={onChageNick} />
            </div>
            <div>
                <label htmlFor="user-pass">비밀번호</label>
                <Input name="user-pass" type="password" required onChange={onChagePassword} />
            </div>
            <div>
                <label htmlFor="user-pass-chk">비밀번호 체크</label>
                <Input name="user-pass-chk" type="password" required onChange={onChagePasswordChk} />
            </div>
            <div>
                <Checkbox name="user-term" onChange={onChangeTerm}>약관 동의</Checkbox>    
            </div>
            <div>
                <Button type="primary" htmlType="submit">가입</Button>
            </div>
        </Form>
    );
};

export default Signup;
